// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

/**
 * @title AccessControl
 * @dev Contract for managing role-based access control for FlowSync contracts
 */
contract AccessControl {
    address public owner;

    // Role definitions
    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");
    bytes32 public constant PAYMENT_MANAGER_ROLE = keccak256("PAYMENT_MANAGER_ROLE");
    bytes32 public constant SUBSCRIPTION_MANAGER_ROLE = keccak256("SUBSCRIPTION_MANAGER_ROLE");

    // Mapping from role to addresses that have that role
    mapping(bytes32 => mapping(address => bool)) private roles;

    // Events
    event RoleGranted(bytes32 indexed role, address indexed account, address indexed sender);
    event RoleRevoked(bytes32 indexed role, address indexed account, address indexed sender);
    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    /**
     * @dev Constructor to set the contract owner
     */
    constructor() {
        owner = msg.sender;
        _grantRole(ADMIN_ROLE, msg.sender);
    }

    /**
     * @dev Modifier to restrict function access to owner only
     */
    modifier onlyOwner() {
        require(msg.sender == owner, "AccessControl: caller is not the owner");
        _;
    }

    /**
     * @dev Modifier to restrict function access to specific role
     * @param role Role required to call the function
     */
    modifier onlyRole(bytes32 role) {
        require(hasRole(role, msg.sender), "AccessControl: caller does not have required role");
        _;
    }

    /**
     * @dev Check if an account has a specific role
     * @param role Role to check
     * @param account Address to check
     * @return bool Whether the account has the role
     */
    function hasRole(bytes32 role, address account) public view returns (bool) {
        return roles[role][account];
    }

    /**
     * @dev Grant a role to an account (admin role required)
     * @param role Role to grant
     * @param account Address to grant role to
     */
    function grantRole(bytes32 role, address account) external onlyRole(ADMIN_ROLE) {
        _grantRole(role, account);
    }

    /**
     * @dev Revoke a role from an account (admin role required)
     * @param role Role to revoke
     * @param account Address to revoke role from
     */
    function revokeRole(bytes32 role, address account) external onlyRole(ADMIN_ROLE) {
        _revokeRole(role, account);
    }

    /**
     * @dev Renounce a role (can only renounce your own roles)
     * @param role Role to renounce
     */
    function renounceRole(bytes32 role) external {
        _revokeRole(role, msg.sender);
    }

    /**
     * @dev Internal function to grant a role
     * @param role Role to grant
     * @param account Address to grant role to
     */
    function _grantRole(bytes32 role, address account) internal {
        if (!hasRole(role, account)) {
            roles[role][account] = true;
            emit RoleGranted(role, account, msg.sender);
        }
    }

    /**
     * @dev Internal function to revoke a role
     * @param role Role to revoke
     * @param account Address to revoke role from
     */
    function _revokeRole(bytes32 role, address account) internal {
        if (hasRole(role, account)) {
            roles[role][account] = false;
            emit RoleRevoked(role, account, msg.sender);
        }
    }

    /**
     * @dev Transfer ownership of the contract (owner only)
     * @param _newOwner New owner address
     */
    function transferOwnership(address _newOwner) external onlyOwner {
        require(_newOwner != address(0), "AccessControl: new owner cannot be zero address");
        emit OwnershipTransferred(owner, _newOwner);
        owner = _newOwner;
        _grantRole(ADMIN_ROLE, _newOwner);
    }
}

contracts/EscrowContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./AccessControl.sol";

/**
 * @title EscrowContract
 * @dev Contract for holding funds in escrow for FlowSync payments
 */
contract EscrowContract {
    address public owner;
    AccessControl public accessControl;

    // Escrow status enum
    enum EscrowStatus { Created, Funded, Released, Refunded, Disputed, Resolved }

    // Escrow structure
    struct Escrow {
        uint256 id;
        address payer;
        address payee;
        uint256 amount;
        uint256 createdAt;
        uint256 releasedAt;
        EscrowStatus status;
        string metadata; // JSON string with additional escrow data
    }

    // Mapping escrow ID to Escrow
    mapping(uint256 => Escrow) public escrows;
    uint256 public nextEscrowId;

    // Events
    event EscrowCreated(uint256 indexed escrowId, address indexed payer, address indexed payee, uint256 amount);
    event EscrowFunded(uint256 indexed escrowId, address indexed payer, uint256 amount);
    event EscrowReleased(uint256 indexed escrowId, address indexed payee, uint256 amount);
    event EscrowRefunded(uint256 indexed escrowId, address indexed payer, uint256 amount);
    event EscrowDisputed(uint256 indexed escrowId, string reason);
    event EscrowResolved(uint256 indexed escrowId, EscrowStatus resolution);

    /**
     * @dev Constructor to set the contract owner and AccessControl contract
     * @param _accessControlAddress Address of the AccessControl contract
     */
    constructor(address _accessControlAddress) {
        owner = msg.sender;
        accessControl = AccessControl(_accessControlAddress);
        nextEscrowId = 1;
    }

    /**
     * @dev Modifier to restrict function access to owner only
     */
    modifier onlyOwner() {
        require(msg.sender == owner, "EscrowContract: caller is not the owner");
        _;
    }

    /**
     * @dev Modifier to restrict function access to payment manager role
     */
    modifier onlyPaymentManager() {
        require(accessControl.hasRole(accessControl.PAYMENT_MANAGER_ROLE(), msg.sender), 
                "EscrowContract: caller does not have payment manager role");
        _;
    }

    /**
     * @dev Create a new escrow agreement
     * @param _payee Address that will receive funds
     * @param _metadata JSON string with additional escrow data
     * @return escrowId The ID of the created escrow
     */
    function createEscrow(address _payee, string memory _metadata) external payable returns (uint256) {
        require(_payee != address(0), "EscrowContract: payee cannot be zero address");
        require(msg.value > 0, "EscrowContract: escrow amount must be greater than 0");

        uint256 escrowId = nextEscrowId++;

        // Create escrow record
        escrows[escrowId] = Escrow({
            id: escrowId,
            payer: msg.sender,
            payee: _payee,
            amount: msg.value,
            createdAt: block.timestamp,
            releasedAt: 0,
            status: EscrowStatus.Funded,
            metadata: _metadata
        });

        emit EscrowCreated(escrowId, msg.sender, _payee, msg.value);
        emit EscrowFunded(escrowId, msg.sender, msg.value);

        return escrowId;
    }

    /**
     * @dev Release funds from escrow to payee
     * @param _escrowId Escrow ID to release
     */
    function releaseEscrow(uint256 _escrowId) external {
        Escrow storage escrow = escrows[_escrowId];

        require(escrow.id == _escrowId, "EscrowContract: escrow does not exist");
        require(escrow.status == EscrowStatus.Funded, "EscrowContract: escrow not in funded state");
        require(
            msg.sender == escrow.payer || 
            msg.sender == owner || 
            accessControl.hasRole(accessControl.PAYMENT_MANAGER_ROLE(), msg.sender),
            "EscrowContract: caller not authorized to release escrow"
        );

        escrow.status = EscrowStatus.Released;
        escrow.releasedAt = block.timestamp;

        // Transfer funds to payee
        (bool success, ) = escrow.payee.call{value: escrow.amount}("");
        require(success, "EscrowContract: release transfer failed");

        emit EscrowReleased(_escrowId, escrow.payee, escrow.amount);
    }

    /**
     * @dev Refund escrow to payer
     * @param _escrowId Escrow ID to refund
     */
    function refundEscrow(uint256 _escrowId) external onlyPaymentManager {
        Escrow storage escrow = escrows[_escrowId];

        require(escrow.id == _escrowId, "EscrowContract: escrow does not exist");
        require(escrow.status == EscrowStatus.Funded || escrow.status == EscrowStatus.Disputed, 
                "EscrowContract: escrow not in refundable state");

        escrow.status = EscrowStatus.Refunded;

        // Transfer funds back to payer
        (bool success, ) = escrow.payer.call{value: escrow.amount}("");
        require(success, "EscrowContract: refund transfer failed");

        emit EscrowRefunded(_escrowId, escrow.payer, escrow.amount);
    }

    /**
     * @dev Mark an escrow as disputed
     * @param _escrowId Escrow ID to dispute
     * @param _reason Reason for dispute
     */
    function disputeEscrow(uint256 _escrowId, string memory _reason) external {
        Escrow storage escrow = escrows[_escrowId];

        require(escrow.id == _escrowId, "EscrowContract: escrow does not exist");
        require(escrow.status == EscrowStatus.Funded, "EscrowContract: escrow not in funded state");
        require(
            msg.sender == escrow.payer || 
            msg.sender == escrow.payee,
            "EscrowContract: only payer or payee can dispute escrow"
        );

        escrow.status = EscrowStatus.Disputed;

        emit EscrowDisputed(_escrowId, _reason);
    }

    /**
     * @dev Resolve a disputed escrow
     * @param _escrowId Escrow ID to resolve
     * @param _resolution Final status for the escrow (Released or Refunded)
     */
    function resolveDispute(uint256 _escrowId, EscrowStatus _resolution) external onlyPaymentManager {
        Escrow storage escrow = escrows[_escrowId];

        require(escrow.id == _escrowId, "EscrowContract: escrow does not exist");
        require(escrow.status == EscrowStatus.Disputed, "EscrowContract: escrow not in disputed state");
        require(
            _resolution == EscrowStatus.Released || 
            _resolution == EscrowStatus.Refunded,
            "EscrowContract: invalid resolution status"
        );

        if (_resolution == EscrowStatus.Released) {
            // Transfer funds to payee
            (bool success, ) = escrow.payee.call{value: escrow.amount}("");
            require(success, "EscrowContract: resolution release transfer failed");

            emit EscrowReleased(_escrowId, escrow.payee, escrow.amount);
        } else {
            // Transfer funds back to payer
            (bool success, ) = escrow.payer.call{value: escrow.amount}("");
            require(success, "EscrowContract: resolution refund transfer failed");

            emit EscrowRefunded(_escrowId, escrow.payer, escrow.amount);
        }

        escrow.status = EscrowStatus.Resolved;
        escrow.releasedAt = block.timestamp;

        emit EscrowResolved(_escrowId, _resolution);
    }

    /**
     * @dev Get escrow details
     * @param _escrowId Escrow ID to query
     * @return Escrow struct with escrow details
     */
    function getEscrow(uint256 _escrowId) external view returns (Escrow memory) {
        require(escrows[_escrowId].id == _escrowId, "EscrowContract: escrow does not exist");
        return escrows[_escrowId];
    }

    /**
     * @dev Transfer ownership of the contract (owner only)
     * @param _newOwner New owner address
     */
    function transferOwnership(address _newOwner) external onlyOwner {
        require(_newOwner != address(0), "EscrowContract: new owner cannot be zero address");
        owner = _newOwner;
    }

    /**
     * @dev Emergency withdrawal function (owner only)
     * @notice This should only be used in critical situations!
     */
    function emergencyWithdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "EscrowContract: no balance to withdraw");

        (bool success, ) = owner.call{value: balance}("");
        require(success, "EscrowContract: withdrawal failed");
    }
}

contracts/PaymentProcessor.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

/**
 * @title PaymentProcessor
 * @dev Contract for processing BNB payments for FlowSync
 */
contract PaymentProcessor {
    address public owner;
    address public feeCollector;
    uint256 public feePercentage; // Fee in basis points (1/100 of a percent)

    // Payment status enum
    enum PaymentStatus { Pending, Completed, Refunded, Failed }

    // Payment structure
    struct Payment {
        uint256 id;
        address payer;
        uint256 amount;
        uint256 timestamp;
        PaymentStatus status;
        string metadata; // JSON string with additional payment data
    }

    // Mapping from payment ID to Payment
    mapping(uint256 => Payment) public payments;
    uint256 public nextPaymentId;

    // Events
    event PaymentReceived(uint256 indexed paymentId, address indexed payer, uint256 amount, string metadata);
    event PaymentUpdated(uint256 indexed paymentId, PaymentStatus status);
    event FeePercentageUpdated(uint256 oldFee, uint256 newFee);
    event FeeCollectorUpdated(address oldCollector, address newCollector);

    /**
     * @dev Constructor to set the contract owner and initial parameters
     * @param _feeCollector Address that will receive fees
     * @param _feePercentage Fee percentage in basis points (1% = 100)
     */
    constructor(address _feeCollector, uint256 _feePercentage) {
        owner = msg.sender;
        feeCollector = _feeCollector;
        feePercentage = _feePercentage;
        nextPaymentId = 1;
    }

    /**
     * @dev Modifier to restrict function access to owner only
     */
    modifier onlyOwner() {
        require(msg.sender == owner, "PaymentProcessor: caller is not the owner");
        _;
    }

    /**
     * @dev Process a payment from a user
     * @param _metadata JSON string with additional payment information
     * @return paymentId The ID of the created payment
     */
    function processPayment(string memory _metadata) external payable returns (uint256) {
        require(msg.value > 0, "PaymentProcessor: payment amount must be greater than 0");

        uint256 paymentId = nextPaymentId++;

        // Calculate fee
        uint256 feeAmount = (msg.value * feePercentage) / 10000;
        uint256 remainingAmount = msg.value - feeAmount;

        // Create payment record
        payments[paymentId] = Payment({
            id: paymentId,
            payer: msg.sender,
            amount: msg.value,
            timestamp: block.timestamp,
            status: PaymentStatus.Completed,
            metadata: _metadata
        });

        // Transfer fee to fee collector
        if (feeAmount > 0) {
            (bool feeSuccess, ) = feeCollector.call{value: feeAmount}("");
            require(feeSuccess, "PaymentProcessor: fee transfer failed");
        }

        // Transfer remaining amount to owner
        (bool success, ) = owner.call{value: remainingAmount}("");
        require(success, "PaymentProcessor: payment transfer failed");

        emit PaymentReceived(paymentId, msg.sender, msg.value, _metadata);

        return paymentId;
    }

    /**
     * @dev Set a new fee percentage (owner only)
     * @param _feePercentage New fee percentage in basis points
     */
    function setFeePercentage(uint256 _feePercentage) external onlyOwner {
        require(_feePercentage <= 1000, "PaymentProcessor: fee percentage cannot exceed 10%");

        emit FeePercentageUpdated(feePercentage, _feePercentage);
        feePercentage = _feePercentage;
    }

    /**
     * @dev Set a new fee collector address (owner only)
     * @param _feeCollector New fee collector address
     */
    function setFeeCollector(address _feeCollector) external onlyOwner {
        require(_feeCollector != address(0), "PaymentProcessor: fee collector cannot be zero address");

        emit FeeCollectorUpdated(feeCollector, _feeCollector);
        feeCollector = _feeCollector;
    }

    /**
     * @dev Update payment status (owner only)
     * @param _paymentId Payment ID to update
     * @param _status New payment status
     */
    function updatePaymentStatus(uint256 _paymentId, PaymentStatus _status) external onlyOwner {
        require(payments[_paymentId].id == _paymentId, "PaymentProcessor: payment does not exist");

        payments[_paymentId].status = _status;
        emit PaymentUpdated(_paymentId, _status);
    }

    /**
     * @dev Get payment details
     * @param _paymentId Payment ID to query
     * @return Payment struct with payment details
     */
    function getPayment(uint256 _paymentId) external view returns (Payment memory) {
        require(payments[_paymentId].id == _paymentId, "PaymentProcessor: payment does not exist");
        return payments[_paymentId];
    }

    /**
     * @dev Transfer ownership of the contract (owner only)
     * @param _newOwner New owner address
     */
    function transferOwnership(address _newOwner) external onlyOwner {
        require(_newOwner != address(0), "PaymentProcessor: new owner cannot be zero address");
        owner = _newOwner;
    }

    /**
     * @dev Emergency withdrawal function (owner only)
     */
    function emergencyWithdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "PaymentProcessor: no balance to withdraw");

        (bool success, ) = owner.call{value: balance}("");
        require(success, "PaymentProcessor: withdrawal failed");
    }
}

contracts/SubscriptionManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./PaymentProcessor.sol";

/**
 * @title SubscriptionManager
 * @dev Contract for managing subscriptions paid in BNB
 */
contract SubscriptionManager {
    address public owner;
    PaymentProcessor public paymentProcessor;

    // Subscription tier enum
    enum SubscriptionTier { Free, Pro, Enterprise }

    // Billing period enum
    enum BillingPeriod { Monthly, Annual }

    // Subscription structure
    struct Subscription {
        uint256 id;
        address subscriber;
        SubscriptionTier tier;
        BillingPeriod billingPeriod;
        uint256 startDate;
        uint256 endDate;
        uint256 lastPaymentId;
        bool autoRenew;
        bool active;
    }

    // Price structure
    struct PricePoint {
        uint256 monthlyPrice; // Price in wei
        uint256 annualPrice;  // Price in wei
    }

    // Mapping subscription tiers to prices
    mapping(SubscriptionTier => PricePoint) public subscriptionPrices;

    // Mapping from address to subscription
    mapping(address => Subscription) public subscriptions;

    // Mapping from address to subscription history
    mapping(address => Subscription[]) public subscriptionHistory;

    // Subscription count
    uint256 public nextSubscriptionId;

    // Events
    event SubscriptionCreated(uint256 indexed subscriptionId, address indexed subscriber, SubscriptionTier tier, BillingPeriod period, uint256 endDate);
    event SubscriptionCancelled(uint256 indexed subscriptionId, address indexed subscriber);
    event SubscriptionRenewed(uint256 indexed subscriptionId, address indexed subscriber, uint256 newEndDate);
    event SubscriptionTierChanged(uint256 indexed subscriptionId, address indexed subscriber, SubscriptionTier oldTier, SubscriptionTier newTier);
    event PriceUpdated(SubscriptionTier tier, uint256 monthlyPrice, uint256 annualPrice);

    /**
     * @dev Constructor to set the contract owner and payment processor
     * @param _paymentProcessorAddress Address of the PaymentProcessor contract
     */
    constructor(address _paymentProcessorAddress) {
        owner = msg.sender;
        paymentProcessor = PaymentProcessor(_paymentProcessorAddress);
        nextSubscriptionId = 1;

        // Set initial prices (in wei)
        // Pro tier: 0.05 BNB monthly / 0.5 BNB annually
        subscriptionPrices[SubscriptionTier.Pro] = PricePoint({
            monthlyPrice: 50000000000000000, // 0.05 BNB in wei
            annualPrice: 500000000000000000  // 0.5 BNB in wei
        });

        // Enterprise tier: 0.2 BNB monthly / 2.0 BNB annually
        subscriptionPrices[SubscriptionTier.Enterprise] = PricePoint({
            monthlyPrice: 200000000000000000, // 0.2 BNB in wei
            annualPrice: 2000000000000000000  // 2.0 BNB in wei
        });

        // Free tier is always 0
        subscriptionPrices[SubscriptionTier.Free] = PricePoint({
            monthlyPrice: 0,
            annualPrice: 0
        });
    }

    /**
     * @dev Modifier to restrict function access to owner only
     */
    modifier onlyOwner() {
        require(msg.sender == owner, "SubscriptionManager: caller is not the owner");
        _;
    }

    /**
     * @dev Purchase a subscription
     * @param _tier Subscription tier to purchase
     * @param _period Billing period (monthly or annual)
     * @param _autoRenew Whether to auto-renew the subscription
     * @return subscriptionId The ID of the created subscription
     */
    function purchaseSubscription(SubscriptionTier _tier, BillingPeriod _period, bool _autoRenew) external payable returns (uint256) {
        // Check if tier is valid
        require(_tier == SubscriptionTier.Free || _tier == SubscriptionTier.Pro || _tier == SubscriptionTier.Enterprise, 
                "SubscriptionManager: invalid tier");

        // Calculate required payment amount
        uint256 requiredAmount = _period == BillingPeriod.Monthly ? 
                                subscriptionPrices[_tier].monthlyPrice : 
                                subscriptionPrices[_tier].annualPrice;

        // Free tier doesn't need payment
        if (_tier != SubscriptionTier.Free) {
            require(msg.value >= requiredAmount, "SubscriptionManager: insufficient payment amount");
        }

        uint256 subscriptionId = nextSubscriptionId++;
        uint256 duration = _period == BillingPeriod.Monthly ? 30 days : 365 days;
        uint256 endDate = block.timestamp + duration;
        uint256 paymentId = 0;

        // For paid tiers, process payment
        if (_tier != SubscriptionTier.Free && msg.value > 0) {
            string memory metadata = string(abi.encodePacked(
                '{"subscriptionId":"', _uint2str(subscriptionId), 
                '","tier":"', _tierToString(_tier),
                '","period":"', _periodToString(_period), '"}'
            ));

            // Forward payment to the payment processor
            paymentId = paymentProcessor.processPayment{value: msg.value}(metadata);
        }

        // Archive current subscription to history if exists
        if (subscriptions[msg.sender].id > 0 && subscriptions[msg.sender].active) {
            subscriptionHistory[msg.sender].push(subscriptions[msg.sender]);
            subscriptions[msg.sender].active = false;
        }

        // Create new subscription
        subscriptions[msg.sender] = Subscription({
            id: subscriptionId,
            subscriber: msg.sender,
            tier: _tier,
            billingPeriod: _period,
            startDate: block.timestamp,
            endDate: endDate,
            lastPaymentId: paymentId,
            autoRenew: _autoRenew,
            active: true
        });

        emit SubscriptionCreated(subscriptionId, msg.sender, _tier, _period, endDate);
        return subscriptionId;
    }

    /**
     * @dev Cancel subscription
     */
    function cancelSubscription() external {
        require(subscriptions[msg.sender].active, "SubscriptionManager: no active subscription");

        // Move to history
        subscriptionHistory[msg.sender].push(subscriptions[msg.sender]);

        // Mark as inactive
        subscriptions[msg.sender].active = false;
        subscriptions[msg.sender].autoRenew = false;

        emit SubscriptionCancelled(subscriptions[msg.sender].id, msg.sender);
    }

    /**
     * @dev Change subscription tier
     * @param _newTier New subscription tier
     * @param _newPeriod New billing period
     * @return Required additional payment to upgrade, or 0 if downgrading
     */
    function changeTier(SubscriptionTier _newTier, BillingPeriod _newPeriod) external view returns (uint256) {
        require(subscriptions[msg.sender].active, "SubscriptionManager: no active subscription");

        SubscriptionTier currentTier = subscriptions[msg.sender].tier;
        BillingPeriod currentPeriod = subscriptions[msg.sender].billingPeriod;

        // If moving to free, no payment needed
        if (_newTier == SubscriptionTier.Free) {
            return 0;
        }

        // Calculate remaining time on current subscription
        uint256 remainingTime = subscriptions[msg.sender].endDate - block.timestamp;

        // Get current and new prices
        uint256 currentPrice = currentPeriod == BillingPeriod.Monthly ? 
                              subscriptionPrices[currentTier].monthlyPrice : 
                              subscriptionPrices[currentTier].annualPrice;

        uint256 newPrice = _newPeriod == BillingPeriod.Monthly ? 
                          subscriptionPrices[_newTier].monthlyPrice : 
                          subscriptionPrices[_newTier].annualPrice;

        // Calculate prorated current value
        uint256 periodDuration = currentPeriod == BillingPeriod.Monthly ? 30 days : 365 days;
        uint256 proratedCurrentValue = (currentPrice * remainingTime) / periodDuration;

        // Calculate required new payment (newPrice - proratedCurrentValue)
        // If downgrading, no additional payment needed
        if (newPrice <= proratedCurrentValue) {
            return 0;
        } else {
            return newPrice - proratedCurrentValue;
        }
    }

    /**
     * @dev Process tier change payment
     * @param _newTier New subscription tier
     * @param _newPeriod New billing period
     * @param _autoRenew Whether to auto-renew the subscription
     */
    function processTierChange(SubscriptionTier _newTier, BillingPeriod _newPeriod, bool _autoRenew) external payable {
        require(subscriptions[msg.sender].active, "SubscriptionManager: no active subscription");

        SubscriptionTier oldTier = subscriptions[msg.sender].tier;
        uint256 requiredAmount = this.changeTier(_newTier, _newPeriod);

        // Check payment amount
        if (requiredAmount > 0) {
            require(msg.value >= requiredAmount, "SubscriptionManager: insufficient payment for tier change");
        }

        uint256 paymentId = 0;

        // Process payment if needed
        if (requiredAmount > 0 && msg.value > 0) {
            string memory metadata = string(abi.encodePacked(
                '{"subscriptionId":"', _uint2str(subscriptions[msg.sender].id), 
                '","action":"tier_change",',
                '"oldTier":"', _tierToString(oldTier),
                '","newTier":"', _tierToString(_newTier),
                '","period":"', _periodToString(_newPeriod), '"}'
            ));

            // Forward payment to payment processor
            paymentId = paymentProcessor.processPayment{value: msg.value}(metadata);
        }

        // Calculate new end date
        uint256 duration = _newPeriod == BillingPeriod.Monthly ? 30 days : 365 days;
        uint256 newEndDate = block.timestamp + duration;

        // Update subscription
        subscriptions[msg.sender].tier = _newTier;
        subscriptions[msg.sender].billingPeriod = _newPeriod;
        subscriptions[msg.sender].startDate = block.timestamp;
        subscriptions[msg.sender].endDate = newEndDate;

        if (requiredAmount > 0) {
            subscriptions[msg.sender].lastPaymentId = paymentId;
        }

        subscriptions[msg.sender].autoRenew = _autoRenew;

        emit SubscriptionTierChanged(subscriptions[msg.sender].id, msg.sender, oldTier, _newTier);
    }

    /**
     * @dev Get subscription details for a user
     * @param _user Address of the user
     * @return Subscription struct with subscription details
     */
    function getSubscription(address _user) external view returns (Subscription memory) {
        return subscriptions[_user];
    }

    /**
     * @dev Get subscription history for a user
     * @param _user Address of the user
     * @return Array of subscription structs
     */
    function getSubscriptionHistory(address _user) external view returns (Subscription[] memory) {
        return subscriptionHistory[_user];
    }

    /**
     * @dev Update subscription prices (owner only)
     * @param _tier Tier to update
     * @param _monthlyPrice New monthly price in wei
     * @param _annualPrice New annual price in wei
     */
    function updatePrices(SubscriptionTier _tier, uint256 _monthlyPrice, uint256 _annualPrice) external onlyOwner {
        subscriptionPrices[_tier] = PricePoint({
            monthlyPrice: _monthlyPrice,
            annualPrice: _annualPrice
        });

        emit PriceUpdated(_tier, _monthlyPrice, _annualPrice);
    }

    /**
     * @dev Transfer ownership of the contract (owner only)
     * @param _newOwner New owner address
     */
    function transferOwnership(address _newOwner) external onlyOwner {
        require(_newOwner != address(0), "SubscriptionManager: new owner cannot be zero address");
        owner = _newOwner;
    }

    /**
     * @dev Check if a user's subscription is active and not expired
     * @param _user Address of the user
     * @return bool Whether the subscription is active and not expired
     */
    function isActiveSubscription(address _user) external view returns (bool) {
        return subscriptions[_user].active && subscriptions[_user].endDate >= block.timestamp;
    }

    /**
     * @dev Convert uint to string (helper function)
     * @param _value Value to convert
     * @return string representation
     */
    function _uint2str(uint256 _value) internal pure returns (string memory) {
        if (_value == 0) {
            return "0";
        }

        uint256 temp = _value;
        uint256 digits;

        while (temp != 0) {
            digits++;
            temp /= 10;
        }

        bytes memory buffer = new bytes(digits);
        while (_value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(_value % 10)));
            _value /= 10;
        }

        return string(buffer);
    }

    /**
     * @dev Convert tier enum to string (helper function)
     * @param _tier Tier enum
     * @return string representation
     */
    function _tierToString(SubscriptionTier _tier) internal pure returns (string memory) {
        if (_tier == SubscriptionTier.Free) return "Free";
        if (_tier == SubscriptionTier.Pro) return "Pro";
        if (_tier == SubscriptionTier.Enterprise) return "Enterprise";
        return "Unknown";
    }

    /**
     * @dev Convert period enum to string (helper function)
     * @param _period Period enum
     * @return string representation
     */
    function _periodToString(BillingPeriod _period) internal pure returns (string memory) {
        if (_period == BillingPeriod.Monthly) return "Monthly";
        if (_period == BillingPeriod.Annual) return "Annual";
        return "Unknown";
    }
}

